import React, { Component } from 'react';

class VideoStream extends Component {
    render() {
        return (
            <div>
                <YouTube
                    videoId={this.state.videoID}
                    opts={opts}
                    onReady={this.videoOnReady}
                    onStateChange={this.videoStateChange}
                />
            </div>
        );
    }
}

export default VideoStream;
